SELECT AVG(CAST("Wins_2"."nFNT0" AS double)) AS "avg:nFNT0:ok",   SUM(1) AS "cnt:nFNT0:ok",   "Wins_2"."tPP1TRK" AS "tPP1TRK" FROM "Wins_2" WHERE (("Wins_2"."tPP1TRK" IN ('AQU', 'BEL', 'BTP', 'CD', 'CRC', 'DEL', 'DMR', 'ELP', 'EMD', 'EVD', 'FE', 'FG', 'FL', 'FP', 'GP', 'HAW', 'HP', 'IND', 'KEE', 'LAD', 'LRC', 'LRL', 'LS', 'MNR', 'MTH', 'MVR', 'NP', 'OP', 'PEN', 'PHA', 'PIM', 'PM', 'PRM', 'SA', 'SAR', 'SUF', 'SUN', 'TAM', 'TDN', 'TUP', 'ZIA')) AND ("Wins_2"."tTRK3" NOT IN ('MD', 'RET', 'PLN', 'ONE', 'BCF', 'WRD', 'HST', 'HPO', 'PRV', 'ASD', 'CLS', 'FAR', 'TIL', 'GPR', 'ELK', 'ARP', 'SWF', 'EMD', 'CAS', 'CBY', 'SDY', 'ZIA', 'CWF', 'RIL', 'RP', 'BKF', 'FON', 'ALB', 'FER', 'SRP', 'RUI', 'DEP', 'ELY', 'GF', 'EMT', 'GIL', 'MED', 'ABT', 'PHA', 'BOI', 'OTC', 'UN', 'LNN', 'SUD', 'LBG', 'WYO', 'SON', 'MIL', 'FTP', 'GRP', 'FMT', 'CPW')) AND ("Wins_2"."nFNT0" >= cast('7' as double)) AND ("Wins_2"."nFNT0" <= cast('153' as double)) AND (CAST("Wins_2"."nPP1CLA" AS BIGINT) = 2) AND ("Wins_2"."nPP1DIS" = cast('6' as double)) AND (CAST("Wins_2"."nPP1SOR" AS BIGINT) IN (90, 91, 92, 93, 94, 95, 96, 97, 98, 99)) AND (CAST("Wins_2"."nPP1SUR" AS BIGINT) = 1) AND (CAST("Wins_2"."nSURF2" AS BIGINT) >= 1) AND (CAST("Wins_2"."nSURF2" AS BIGINT) <= 4)) GROUP BY "Wins_2"."tPP1TRK" ORDER BY "avg:nFNT0:ok";
